      INTEGER, PARAMETER :: ACTP             =  86                                                                      
      INTEGER, PARAMETER :: MEKP             =  87                                                                      
      INTEGER, PARAMETER :: KETP             =  88                                                                      
      INTEGER, PARAMETER :: MCP              =  89                                                                      
      INTEGER, PARAMETER :: MVKP             =  90                                                                      
      INTEGER, PARAMETER :: UALP             =  91                                                                      
      INTEGER, PARAMETER :: DCB3             =  92                                                                      
