      INTEGER, PARAMETER :: IEPOX            = 102                                                                      
      INTEGER, PARAMETER :: MAHP             = 103                                                                      
      INTEGER, PARAMETER :: ORA2             = 104                                                                      
      INTEGER, PARAMETER :: ORAP             = 105                                                                      
      INTEGER, PARAMETER :: PPN              = 106                                                                      
      INTEGER, PARAMETER :: MPAN             = 107                                                                      
      INTEGER, PARAMETER :: NALD             = 108                                                                      
