      INTEGER, PARAMETER :: SESQRXN          = 128                                                                      
      INTEGER, PARAMETER :: NAPH             = 129                                                                      
      INTEGER, PARAMETER :: PAHRO2           = 130                                                                      
      INTEGER, PARAMETER :: PAHNRXN          = 131                                                                      
      INTEGER, PARAMETER :: PAHHRXN          = 132                                                                      
      INTEGER, PARAMETER :: SOAALK           = 133                                                                      
      INTEGER, PARAMETER :: ALKRXN           = 134                                                                      

cccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccc

      IF( FIRSTIME ) THEN                                                                                               

         IF( MECHNAME .NE. 'RACM2_AE6_AQ                    ' ) THEN                                                    
            MSG =  'This Jacobian was built for RACM2_AE6_AQ                     '                                      
     &            // MECHNAME // ' is in use. Exiting.'                                                                 
            CALL M3EXIT( PNAME, 0, 0, MSG, XSTAT1 )                                                                     
         ENDIF                                                                                                          

         IF ( N_GC_SPC .NE. NJACSPC ) THEN                                                                              
            MSG =  'ERROR: Number of species in Jacobian '                                                              
     &          // 'does not match N_GC_SPC.'                                                                           
            CALL M3EXIT( PNAME, 0, 0, MSG, XSTAT1 )                                                                     
         ELSE IF ( NRXNS .NE. NJACRXN ) THEN                                                                            
            MSG =  'ERROR: Number of reactions in Jacobian '                                                            
     &          // 'does not match NRXNS.'                                                                              
            CALL M3EXIT( PNAME, 0, 0, MSG, XSTAT1 )                                                                     
         ENDIF                                                                                                          

         FIRSTIME = .FALSE.                                                                                             

      ENDIF                                                                                                             

      PD = 0.0                                                                                                          

cccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccc
C  PDs of the rate of change of species   1: O3                                                                         
cccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccc
      PD( O3     ,O3      ) = -           RK( 001 )                                                                     
     &                        -           RK( 002 )                                                                     
     &                        -           RK( 034 ) * C( HO      )                                                      
     &                        -           RK( 035 ) * C( HO2     )                                                      
     &                        -           RK( 036 ) * C( NO      )                                                      
     &                        -           RK( 037 ) * C( NO2     )                                                      
     &                        -           RK( 039 ) * C( O3P     )                                                      
     &                        -           RK( 126 ) * C( ETE     )                                                      
     &                        -           RK( 127 ) * C( OLT     )                                                      
     &                        -           RK( 128 ) * C( OLI     )                                                      
     &                        -           RK( 129 ) * C( DIEN    )                                                      
     &                        -           RK( 130 ) * C( ISO     )                                                      
     &                        -           RK( 131 ) * C( API     )                                                      
     &                        -           RK( 132 ) * C( LIM     )                                                      
     &                        -           RK( 133 ) * C( MACR    )                                                      
     &                        -           RK( 134 ) * C( MVK     )                                                      
     &                        -           RK( 135 ) * C( UALD    )                                                      
     &                        -           RK( 136 ) * C( DCB1    )                                                      
     &                        -           RK( 137 ) * C( DCB2    )                                                      
     &                        -           RK( 138 ) * C( DCB3    )                                                      
     &                        -           RK( 139 ) * C( EPX     )                                                      
     &                        -           RK( 140 ) * C( MCTO    )                                                      
     &                        -           RK( 380 )                                                                     
      PD( O3     ,O3P     ) =             RK( 038 )                                                                     
     &                        -           RK( 039 ) * C( O3      )                                                      
      PD( O3     ,HO      ) = -           RK( 034 ) * C( O3      )                                                      
      PD( O3     ,NO2     ) = -           RK( 037 ) * C( O3      )                                                      
      PD( O3     ,NO      ) = -           RK( 036 ) * C( O3      )                                                      
      PD( O3     ,HO2     ) = -           RK( 035 ) * C( O3      )                                                      
      PD( O3     ,UALD    ) = -           RK( 135 ) * C( O3      )                                                      
      PD( O3     ,MACR    ) = -           RK( 133 ) * C( O3      )                                                      
      PD( O3     ,MVK     ) = -           RK( 134 ) * C( O3      )                                                      
      PD( O3     ,DCB1    ) = -           RK( 136 ) * C( O3      )                                                      
      PD( O3     ,DCB2    ) = -           RK( 137 ) * C( O3      )                                                      
      PD( O3     ,ETE     ) = -           RK( 126 ) * C( O3      )                                                      
      PD( O3     ,OLT     ) = -           RK( 127 ) * C( O3      )                                                      
      PD( O3     ,OLI     ) = -           RK( 128 ) * C( O3      )                                                      
      PD( O3     ,DIEN    ) = -           RK( 129 ) * C( O3      )                                                      
      PD( O3     ,EPX     ) = -           RK( 139 ) * C( O3      )                                                      
      PD( O3     ,ISO     ) = -           RK( 130 ) * C( O3      )                                                      
      PD( O3     ,API     ) = -           RK( 131 ) * C( O3      )                                                      
      PD( O3     ,LIM     ) = -           RK( 132 ) * C( O3      )                                                      
      PD( O3     ,DCB3    ) = -           RK( 138 ) * C( O3      )                                                      
      PD( O3     ,MCTO    ) = -           RK( 140 ) * C( O3      )                                                      

cccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccc
C  PDs of the rate of change of species   2: O3P                                                                        
cccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccc
      PD( O3P    ,O3      ) =             RK( 001 )                                                                     
     &                        -           RK( 039 ) * C( O3P     )                                                      
     &                        + 0.09000 * RK( 129 ) * C( DIEN    )                                                      
      PD( O3P    ,O3P     ) = -           RK( 038 )                                                                     
     &                        -           RK( 039 ) * C( O3      )                                                      
     &                        -           RK( 048 ) * C( NO      )                                                      
     &                        -           RK( 054 ) * C( NO2     )                                                      
     &                        -           RK( 055 ) * C( NO2     )                                                      
      PD( O3P    ,O1D     ) =             RK( 040 )                                                                     
     &                        +           RK( 041 )                                                                     
      PD( O3P    ,NO2     ) =             RK( 004 )                                                                     
     &                        -           RK( 054 ) * C( O3P     )                                                      
     &                        -           RK( 055 ) * C( O3P     )                                                      
      PD( O3P    ,NO      ) = -           RK( 048 ) * C( O3P     )                                                      
      PD( O3P    ,NO3     ) =             RK( 006 )                                                                     
      PD( O3P    ,DIEN    ) =   0.09000 * RK( 129 ) * C( O3      )                                                      

cccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccc
C  PDs of the rate of change of species   3: O1D                                                                        
cccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccc
      PD( O1D    ,O3      ) =             RK( 002 )                                                                     
      PD( O1D    ,O1D     ) = -           RK( 040 )                                                                     
     &                        -           RK( 041 )                                                                     
     &                        -           RK( 042 )                                                                     

cccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccc
C  PDs of the rate of change of species   4: H2O2                                                                       
cccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccc
      PD( H2O2   ,O3      ) =   0.06800 * RK( 127 ) * C( OLT     )                                                      
     &                        + 0.02600 * RK( 128 ) * C( OLI     )                                                      
     &                        + 0.00100 * RK( 129 ) * C( DIEN    )                                                      
     &                        + 0.09000 * RK( 130 ) * C( ISO     )                                                      
     &                        + 0.02000 * RK( 131 ) * C( API     )                                                      
     &                        + 0.02000 * RK( 132 ) * C( LIM     )                                                      
      PD( H2O2   ,H2O2    ) = -           RK( 003 )                                                                     
     &                        -           RK( 047 ) * C( HO      )                                                      
      PD( H2O2   ,HO      ) = -           RK( 047 ) * C( H2O2    )                                                      
      PD( H2O2   ,HO2     ) =   4.00000 * RK( 045 ) * C( HO2     )                                                      
     &                        + 4.00000 * RK( 046 ) * C( HO2     )                                                      
      PD( H2O2   ,OLT     ) =   0.06800 * RK( 127 ) * C( O3      )                                                      
      PD( H2O2   ,OLI     ) =   0.02600 * RK( 128 ) * C( O3      )                                                      
      PD( H2O2   ,DIEN    ) =   0.00100 * RK( 129 ) * C( O3      )                                                      
      PD( H2O2   ,ISO     ) =   0.09000 * RK( 130 ) * C( O3      )                                                      
      PD( H2O2   ,API     ) =   0.02000 * RK( 131 ) * C( O3      )                                                      
      PD( H2O2   ,LIM     ) =   0.02000 * RK( 132 ) * C( O3      )                                                      

cccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccc
C  PDs of the rate of change of species   5: HO                                                                         
cccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccc
      PD( HO     ,O3      ) = -           RK( 034 ) * C( HO      )                                                      
     &                        +           RK( 035 ) * C( HO2     )                                                      
     &                        + 0.08000 * RK( 126 ) * C( ETE     )                                                      
     &                        + 0.22000 * RK( 127 ) * C( OLT     )                                                      
     &                        + 0.46000 * RK( 128 ) * C( OLI     )                                                      
     &                        + 0.28000 * RK( 129 ) * C( DIEN    )                                                      
     &                        + 0.25000 * RK( 130 ) * C( ISO     )                                                      
     &                        + 0.85000 * RK( 131 ) * C( API     )                                                      
     &                        + 0.85000 * RK( 132 ) * C( LIM     )                                                      
     &                        + 0.19000 * RK( 133 ) * C( MACR    )                                                      
     &                        + 0.16000 * RK( 134 ) * C( MVK     )                                                      
     &                        + 0.10000 * RK( 135 ) * C( UALD    )                                                      
     &                        + 0.05000 * RK( 136 ) * C( DCB1    )                                                      
     &                        + 0.05000 * RK( 137 ) * C( DCB2    )                                                      
     &                        + 0.05000 * RK( 138 ) * C( DCB3    )                                                      
     &                        + 0.05000 * RK( 139 ) * C( EPX     )                                                      
      PD( HO     ,O1D     ) =   2.00000 * RK( 042 )                                                                     
      PD( HO     ,H2O2    ) =   2.00000 * RK( 003 )                                                                     
     &                        -           RK( 047 ) * C( HO      )                                                      
      PD( HO     ,HO      ) = -           RK( 034 ) * C( O3      )                                                      
     &                        -           RK( 043 )                                                                     
     &                        -           RK( 044 ) * C( HO2     )                                                      
     &                        -           RK( 047 ) * C( H2O2    )                                                      
     &                        -           RK( 049 ) * C( NO      )                                                      
     &                        -           RK( 053 ) * C( HONO    )                                                      
     &                        -           RK( 056 ) * C( NO2     )                                                      
     &                        -           RK( 057 ) * C( HNO3    )                                                      
     &                        -           RK( 058 ) * C( NO3     )                                                      
     &                        -           RK( 068 ) * C( HNO4    )                                                      
     &                        -           RK( 069 ) * C( SO2     )                                                      
     &                        -           RK( 070 ) * C( CO      )                                                      
     &                        -           RK( 071 )                                                                     
     &                        -           RK( 072 ) * C( ETH     )                                                      
     &                        -           RK( 073 ) * C( HC3     )                                                      
     &                        -           RK( 074 ) * C( HC5     )                                                      
     &                        -           RK( 075 ) * C( HC8     )                                                      
     &                        -           RK( 076 ) * C( ETE     )                                                      
     &                        -           RK( 077 ) * C( OLT     )                                                      
     &                        -           RK( 078 ) * C( OLI     )                                                      
     &                        -           RK( 079 ) * C( DIEN    )                                                      
     &                        - 0.35000 * RK( 080 ) * C( ACE     )                                                      
     &                        -           RK( 081 ) * C( BENZENE )                                                      
     &                        -           RK( 082 ) * C( TOL     )                                                      
     &                        -           RK( 083 ) * C( XYM     )                                                      
     &                        -           RK( 084 ) * C( XYP     )                                                      
     &                        -           RK( 085 ) * C( XYO     )                                                      
     &                        -           RK( 086 ) * C( ISO     )                                                      
     &                        -           RK( 087 ) * C( API     )                                                      
     &                        -           RK( 088 ) * C( LIM     )                                                      
     &                        -           RK( 089 ) * C( HCHO    )                                                      
     &                        -           RK( 090 ) * C( ACD     )                                                      
     &                        -           RK( 091 ) * C( ALD     )                                                      
     &                        -           RK( 092 ) * C( ACT     )                                                      
     &                        -           RK( 093 ) * C( MEK     )                                                      
     &                        -           RK( 094 ) * C( KET     )                                                      
     &                        -           RK( 095 ) * C( HKET    )                                                      
     &                        -           RK( 096 ) * C( MACR    )                                                      
     &                        -           RK( 097 ) * C( MVK     )                                                      
     &                        -           RK( 098 ) * C( UALD    )                                                      
     &                        -           RK( 099 ) * C( GLY     )                                                      
     &                        -           RK( 100 ) * C( MGLY    )                                                      
     &                        -           RK( 101 ) * C( DCB1    )                                                      
     &                        -           RK( 102 ) * C( DCB2    )                                                      
     &                        -           RK( 103 ) * C( DCB3    )                                                      
     &                        -           RK( 104 ) * C( BALD    )                                                      
     &                        -           RK( 105 ) * C( PHEN    )                                                      
     &                        -           RK( 106 ) * C( CSL     )                                                      
     &                        -           RK( 107 ) * C( EPX     )                                                      
     &                        -           RK( 108 ) * C( MCT     )                                                      
     &                        -           RK( 109 ) * C( MOH     )                                                      
     &                        -           RK( 110 ) * C( EOH     )                                                      
     &                        -           RK( 111 ) * C( ROH     )                                                      
     &                        -           RK( 112 ) * C( ETEG    )                                                      
     &                        - 0.65000 * RK( 113 ) * C( OP1     )                                                      
     &                        - 0.99000 * RK( 114 ) * C( OP2     )                                                      
     &                        -           RK( 116 ) * C( MAHP    )                                                      
     &                        -           RK( 117 ) * C( ORA1    )                                                      
     &                        -           RK( 118 ) * C( ORA2    )                                                      
     &                        - 0.65000 * RK( 119 ) * C( PAA     )                                                      
     &                        -           RK( 120 ) * C( PAN     )                                                      
     &                        -           RK( 121 ) * C( PPN     )                                                      
     &                        -           RK( 122 ) * C( MPAN    )                                                      
     &                        -           RK( 123 ) * C( ONIT    )                                                      
     &                        -           RK( 124 ) * C( NALD    )                                                      
     &                        -           RK( 125 ) * C( ISON    )                                                      
      PD( HO     ,NO2     ) = -           RK( 056 ) * C( HO      )                                                      
      PD( HO     ,NO      ) = -           RK( 049 ) * C( HO      )                                                      
     &                        +           RK( 050 ) * C( HO2     )                                                      
      PD( HO     ,NO3     ) = -           RK( 058 ) * C( HO      )                                                      
     &                        + 0.70000 * RK( 059 ) * C( HO2     )                                                      
     &                        + 0.50000 * RK( 157 ) * C( EPX     )                                                      
